import { useNavigate } from "react-router-dom";
import "./Productsave.css";
import { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { productActions } from "../../toolkit/actions/product_action";

const Porductsave = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const [product, setProduct] = useState({
    seller_id: "",
    category_code: "",
    product_name: "",
    product_price: "",
    product_count: "",
    product_img0: null,
  });

  const {
    seller_id,
    category_code,
    product_name,
    product_price,
    product_count,
    product_img0,
  } = product;

  // const [img, setImg] = useState({
  //   product_img0: "",
  // });

  // const { product_img0 } = img;

  const productDetail = useSelector((state) => state.product.productDetail);

  const handleValueChange = (e) => {
    setProduct((prev) => {
      return { ...prev, [e.target.name]: e.target.value };
    });
  };

  const handleFileChange = (e) => {
    e.preventDefault();
    setProduct((prev) => {
      return { ...prev, [e.target.name]: e.target.product_img0[0] };
    });
  };

  const onSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append("seller_id", seller_id);
    formData.append("category_code", category_code);
    formData.append("product_name", product_name);
    formData.append("product_price", product_price);
    formData.append("product_count", product_count);

    if (product_img0 != null) formData.append("product_img0", product_img0);

    console.log("product_img0", product_img0);
    //확인
    for (let [key, value] of formData.entries()) {
      console.log(`${key}: ${value}`);
    }

    try {
      await dispatch(productActions.getProductWrite(formData));
      alert("action 전송 성공.");
    } catch (error) {
      console.error("action 전송 실패", error);
    }

    setProduct({
      seller_id: "",
      category_code: "",
      product_name: "",
      product_price: "",
      product_count: "",
      product_img0: null,
    });
  };

  return (
    <>
      <h1 className="head">물품등록</h1>
      <form className="save" onSubmit={onSubmit}>
        <table>
          <tbody>
            <tr>
              <th>seller_id</th>
              <td>
                <input
                  type="text"
                  name="seller_id"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            <tr>
              <th>category_code</th>
              <td>
                <input
                  type="text"
                  name="category_code"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            <tr>
              <th>product_name</th>
              <td>
                <input
                  type="text"
                  name="product_name"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            <tr>
              <th>product_price</th>
              <td>
                <input
                  type="text"
                  name="product_price"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            <tr>
              <th>product_count</th>
              <td>
                <input
                  type="text"
                  name="product_count"
                  onChange={handleValueChange}
                ></input>
              </td>
            </tr>
            <tr>
              <th width="20%" align="center">
                첨부파일
              </th>
              <td>
                <input
                  type="file"
                  name="filename"
                  id="filepath"
                  onChange={handleFileChange}
                />
              </td>
            </tr>
          </tbody>
        </table>
        <button type="submit" className="btn btn-primary">
          등록완료
        </button>
      </form>
    </>
  );
};

export default Porductsave;
